    ${props.anyProp}={5}
     ${props.booleanProp}={false}
      ${props.numberProp}={678}
       ${props.stringProp}="String"
        ${props.functionProp}={functioner}
         ${props.arrayProp}={[3,4,2,56]}
          ${props.objectPerop}={{name:"DEV" , age:56}}
           ${props.Symbol(symbolProp)}={Symbol("$")}`
           }</h1>
    </>
  )
}
